import React, { Component } from 'react';
import Particles from 'react-particles-js';

const particlesOptions = {
    particles: {
        number: {
            value: 50,
            density: {
                enable: true,
                value_area: 900
            }
        }
    }
}

class Particlesz extends Component{ 
    render(){
        return (
            <Particles 
                params= {particlesOptions} />
        );
    };
}

export default Particles;
